import React from 'react';
import Link from 'next/link';
import searchContainer from '../containers/SearchContainer';
import Search from '../components/searchContainer';

const indexPage = () => {
    return (
        <div>
          <searchContainer />
          <Search />
        </div>
    )
}

export default indexPage;
